import "./Home.css";

function Home(): JSX.Element {
  return (
    <div className="Home">
      <h2>Vacation Management Made Simple</h2>
      <p>
        Effortlessly manage your global vacation portfolio with our intuitive
        dashboard. Track, organize, and update your vacation listings with ease.
        From adding new destinations to monitoring bookings and handling user
        interactions, our platform provides all the tools you need for effective
        vacation management. Streamline your workflow, ensure accuracy, and
        enhance the user experience with our comprehensive management system.
      </p>
    </div>
  );
}

export default Home;
